import React, { useEffect, useState } from 'react'

import { Row, Col, Card, ListGroup, ListGroupItem, Container } from 'react-bootstrap';
const Country = (props) => {


    return (
        <div>
            <Row>
                {
                    props.data.map((data) => {

                        const { id, name, flags, capital, area, population } = data;
                        return (
                            <Col>
                                <Container>
                                    <Card className='m-2' style={{ width: '18rem' }} key={id}>
                                        <Card.Img variant="top" src={flags.png} style={{ height: "200px" }} />
                                        <Card.Body>
                                            <Card.Title>{name.common}</Card.Title>
                                        </Card.Body>
                                        <ListGroup className="list-group-flush">
                                            <ListGroupItem>Capital : {capital}</ListGroupItem>
                                            <ListGroupItem>Population : {population}</ListGroupItem>
                                            <ListGroupItem>Area : {area}</ListGroupItem>
                                            <ListGroupItem className='text-center'><i class="fa fa-2x fa-trash" aria-hidden="true"
                                                onClick={handleClick}
                                            ></i></ListGroupItem>

                                        </ListGroup>
                                    </Card>
                                </Container>

                            </Col>
                        );
                    })
                }
            </Row>

        </div>
    )
}

export default Country
